    MacAllister in the amount of $6,250 which was deposited into our federal account.  Two
    thousand five hundred dollars was transferred to our non-federal account, which
    can accept unlimited contributions from individuals, on 10/12/07.  A letter was
    sent to Mr. MacAllister explaining to him how his contribution was split into
    our accounts and to offer him a chance for a refund.  According to AO 2001-17,
    the Commission has deemed it sufficient to deposit checks that exceed the donor's
    federal limits into our federal account and then to make a transfer to the non-federal
    account for the portion that is over the federal limit.  Therefore, year to date
    aggregate totals reported by P.E. MacAllister on our report is a reflection of
    the federal portion of the donor's contribution to date."
